                "companyName": "«Клиники Столицы» предлагает комплексные обследования, которые включают определенный спектр анализов, позволяющий выявить и предупредить любые проблемы со здоровьем. Любые анализы или консультацию врача у нас Вы можете сделать анонимно. Результаты некоторых исследований можно получить в тот же день. А также мы предоставляем возможность своим пациентам сдать анализы на дому или в офисе.",
